    //     <div className="login_form sm:px-4">
    //       <div className="form-field mb-7 ml-auto mr-auto">
    //         <label className="f-size-13 font-normal formLabelClr">
    //         email
    //         </label>
    //         <input
    //           id="email"
    //           name="email"
    //           type="text"
    //           className="login-email rounded-lg border border-slate-100 border-solid w-full"
    //         //   placeholder={t("static.email")}
    //           {...register("email")}
    //         ></input>
    //         <p className="errors">{errors.email?.message}</p>
    //       </div>
    //       <div className="form-field mb-4 ml-auto mr-auto">
    //         <label className="f-size-13 font-normal formLabelClr">
    //         password
    //         </label>
    //         <input
    //           type={passView ? "text" : "password"}
    //           className="login-email rounded-lg border border-slate-100 border-solid w-full"
    //         //   placeholder={t("static.password")}
    //           {...register("password")}
    //         ></input>
    //         {/* <span className="icon" onClick={() => setPassView(!passView)}>
    //           {passView ? <EyeslashIcon /> : <EyeIcon />}{" "}
    //         </span> */}
    //         <p className="errors">{errors.password?.message}</p>
    //       </div>
    //     </div>
    //     <button
    //       ref={btnRef}
    //       type="submit"
    //       className="sign-in justify-center flex items-center  w-full max-width rounded-lg border py-4 f-size-16 font-bold mb-2.5"
    //     >
    //       signIn
    //     </button>
    //     <button className="forget-pass inline-block" >
    //     forgotYourPassword
    //     </button>
    //   </form>
    // </div>
 <>  
<link rel="stylesheet" href="https://kit-pro.fontawesome.com/releases/v5.15.1/css/pro.min.css" />


<div className="font-semibold self-center text-xl sm:text-2xl  text-gray-800 text-center captilize mt-7">Login</div>


    <div className="mt-7">
      <form  onSubmit={handleSubmit(onSubmitHandler)}>
        <div className="flex flex-col mb-6">

          <div className="relative">


            <input id="email" type="text" name="email" className="text-sm sm:text-base placeholder-gray-500  rounded border border-black h-12 w-full p-2 focus:outline-none focus:border-blue-400" placeholder="E-Mail Address" {...register("email")} />
            <p className="errors">{errors.email?.message}</p>
          </div>
        </div>
        <div className="flex flex-col mb-6">

          <div className="relative">
            <div className="inline-flex items-center justify-center absolute left-0 top-0 h-full w-10 text-gray-400">

            </div>

            <input
             id="password"
              type={passView ? "text" : "password"}
               name="password" className="text-sm sm:text-base placeholder-gray-500 rounded border border-black h-12 w-full p-2 focus:outline-none focus:border-blue-400" placeholder="Password" />
          </div>
        </div>

        <div className="flex items-center mb-6 mt-4">
          <div className="flex ml-auto">
            <a href="#" className="inline-flex text-xs sm:text-sm theme-text-clr">Forgot Your Password?</a>
          </div>
        </div>

        <div className="flex items-center justify-center">
          <button type="submit" className="flex items-center justify-center focus:outline-none text-white theme-btn rounded py-2 w-full transition duration-150 ease-in">
            <span className=" capitilize">Login</span>

          </button>
        </div>
      </form>
    </div>

</> 
  );
};

export default Login;
